import { memo } from 'react'
import Select from 'react-select';
import makeAnimated from 'react-select/animated';
import { AiOutlineWifi } from 'react-icons/ai'

import './RegisterUtilitiesAndServices.scss'

function RegisterUtilitiesAndServices() {
    const animatedComponents = makeAnimated();

    const handleBlur = (input) => {
        input.style.border = 'solid 1px #D9D9D9'
    }

    const handleFocus = (input) => {
        input.style.border = 'solid 1px #4874E8'
    }

    const Internet = [
        {
            value: 0,
            label: 'Wifi Free'
        }
        , {
            value: 1,
            label: 'Lan Internet Access'
        },
        {
            value: 2,
            label: 'INTERNATIONAL_CALL'
        }]

    return (
        <div className='container'>
            <div className='space-30 background-w'>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            placeholder={<label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>}
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
                <div className="d-flex line-input line-input-3-line">
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'

                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                    <div className='w-45'>
                        <label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>
                        <Select id='Internet' className='input-inline basic-multi-select'
                            placeholder={<label htmlFor='Internet' className='d-block'><AiOutlineWifi className='icon-image icon-select' />Internet</label>}
                            isMulti
                            hideSelectedOptions={false}
                            closeMenuOnSelect={false}
                            components={animatedComponents}
                            classNamePrefix="select"
                            options={Internet}
                        />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default memo(RegisterUtilitiesAndServices)
